var title_f7_46_7909="Right bundle branch block 1";
var content_f7_46_7909=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F65619&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F65619&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 508px\">",
"   <div class=\"ttl\">",
"    Complete right bundle branch block",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 488px; height: 142px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The initial myocardial activation is normal; thus, there is a normal septal q wave in leads 1 and V6, followed by a tall R wave. Similarly, there is a normal initial septal R wave followed by a deep S wave in leads aVR and V1. However, the subsequent abnormal right ventricular activation occurs from left to right and goes through the ventricular myocardium instead of the His-Purkinje system; thus, there will be a tall and broad secondary R wave (R') in leads aVR and V1 (a RSR' complex), and a deep and broad S wave in leads I and V6. The width of the QRS complex is &gt;0.12 sec.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
