" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Pathophysiology and etiology of the syndrome of inappropriate antidiuretic hormone secretion (SIADH)",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
